Storyline

Inspired by true events that took place sometime in 1993, Jimmy &amp; Jack DeGrasso, two brothers, went on a blood soaked killing spree of vengeance, for two days. They killed over 17 victims, being active around the clock. Fueled by revenge &amp; cocaine they slaughtered street thugs, hookers, addicts, and drug dealers to find the murderer of their uncle Sal.
